export default async function main(args) {
  return {
    // Choice trace
    trace: [
      {
        type: 'choice',
        payload: {
          buttons: [
            {
              name: "Button A",
              request: { type: 'event_A' }
            },
            {
              name: "Button B",
              request: { type: 'event_B', payload: { data: 100 } }
            },
            {
              name: "Button C",
              request: { type: 'event_B', payload: { data: 200 } }
            }
          ]
        }
      }
    ],

    // Next many command
    next: {
      listen: true,
      to: [
        {
          on: { 'event.type': 'event_A' },
          dest: 'path-A'
        },
        {
          on: { 
	          'event.type': 'event_B',
	          'event.payload.data': 100
	        },
          dest: 'path-B'
        },
        {
          on: { 
	          'event.type': 'event_B',
	          'event.payload.data': 200
	        },
          dest: 'path-C'
        }
      ],
      defaultTo: 'path-D'
    }
  }; 
}
